import React from 'react';
import { FormControl, Row, Col, InputGroup, Button } from 'react-bootstrap'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import './Players.css'

const Players = ({playerList}) => {
  return (
    <div>
      <Row className="justify-content-center mb-2">
        <Col xs={5}>
        <InputGroup size="sm" className="mb-3">
          <FormControl className="playerEntry" type="name" placeholder="new player" />
          <InputGroup.Append>
            <Button variant="outline-secondary">Button</Button>
          </InputGroup.Append>
        </InputGroup>
        </Col>
        <Col xs={1}>
          <FontAwesomeIcon icon="skull" />
        </Col>
      </Row>
    <>
      {playerList.map(player => (<div className="player" key={player}>{player}</div>))}
    </>
    </div>
    
  );
}

export default Players;
